function loadPage(e){fetch(e).then((t=>{if(!t.ok)throw new Error(`Cannot load ${e}`);return t.text()})).then((t=>{document.querySelectorAll("link[data-dynamic]").forEach((e=>e.remove()));let c="";if(e.includes("dashboard")?c="style/dashboard.css":e.includes("profile")?c="style/profile.css":e.includes("Work_Experience")?c="style/work.css":e.includes("Project_Experience")?c="style/project.css":e.includes("certificates")&&(c="style/certificates.css"),c){const e=document.createElement("link");e.rel="stylesheet",e.href=c,e.setAttribute("data-dynamic",""),document.head.appendChild(e)}document.getElementById("content").innerHTML=t})).catch(console.error)}